import React from "react";
import User from "./user";
import "./style/style.css";

const State = ({ states, country }) => {

  return (
    states.map((state) => {
      return (
        <User
          key={state.id}
          stateName={state.name}
          users={state.users}
          country={country}
        />
      );
    })
  );
};

export default State;
